import React from 'react';
import styled from 'styled-components';
import SmoothCorners from '../components/common/SmoothCorner';

const CirclesContainer = styled.div`
  width: 1.6rem;
  height: 1.6rem;
  position: relative;
`;

const Circle = styled.span`
  position: absolute;
  top: 0;
  left: 0;
  width: 5px;
  height: 5px;
  border: 1.4px solid var(--ui-04);
  border-radius: 50%;
`;

const NavButton = () => {
  return (
    <SmoothCorners>
      <CirclesContainer>
        <Circle top="0" left="0" />
        <Circle top="0" right="0" />
        <Circle position="bottom right" />
        <Circle position="top right" />
      </CirclesContainer>
    </SmoothCorners>
  );
};

export default NavButton;
